import TopBar from "../../component/view/appBar";

const Profile = (props) => {
    const [formData, setFormData] = useState({
        user: {
            username: "",
            password: ""
        },
    });

    const handleChange = (e) => {
        setFormData({
            user: {
                ...formData.user,
                [e.target.name]: e.target.value,
            },
        });
    };

    return (
        <>
            {/* <TopBar /> */}
